import { Fragment } from "react";
import WhatsAppIcon from "@material-ui/icons/WhatsApp";
import MailOutlineIcon from "@material-ui/icons/MailOutline";
import Facebook from "@material-ui/icons/Facebook";
import Instagram from "@material-ui/icons/Instagram";
import logo from "../../images/Logo-Blanco.png";
import style from "./Footer.module.css"

export default function Footer() {
  return (
    <Fragment>
      <div className={style.footer}>
        <div className={style.contacto}>
          <div className={style.left_contact}>
            <div className={style.container_left}>
              <MailOutlineIcon 
              style={{ margin: "7px" }} 
              style={{cursor:"pointer"}} 
              onClick={()=>window.open('localhost:3000/contact')}/> 
          Contactanos
            </div>
            <div
              style={{
                display: "flex",
                flexDirection: "row",
                alignItems: "center",
              }}
            >
              <WhatsAppIcon style={{ margin: "7px" }} />
              +54 911 2233 4455
            </div>
          </div>

          <div className={style.right_contact}>
            <Instagram style={{ display: "block", margin: "7px" }} />
            <Facebook style={{ margin: "7px" }} onClick={()=>window.open('https://m.facebook.com/Makelaar-110691244682513/', '_blank')}/>
          </div>
        </div>

        <div className={style.linea} />

        <div className={style.derechos}>Â© 2021 HLearning.All Rights Reserved</div>

        <div className={style.linea} />

        <div className={style.logo_footer}>
          <img className={style.img} src={logo} alt="logo"/>
        </div>

       </div>
    </Fragment>
  );
}
